import React, { useState, useEffect } from 'react';
import ReactSlider from 'react-slider';
import './JogControl.css';

const JogControl = ({ sendWebSocketMessage }) => {
  const [mode, setMode] = useState('joint'); // 'joint' or 'cartesian'
  const [velocity, setVelocity] = useState(50); // 0-100%
  const [activeJog, setActiveJog] = useState(null);

  const joints = {
    base_rotation: 'Base',
    shoulder_rotation: 'Shoulder',
    prismatic_extension: 'Extension',
    elbow_rotation: 'Elbow',
    wrist_rotation: 'Wrist',
    end_effector_rotation: 'End Effector'
  };

  const axes = {
    x: 'X',
    y: 'Y',
    z: 'Z',
    roll: 'Roll',
    pitch: 'Pitch',
    yaw: 'Yaw'
  };

  // Handle keyboard controls
  useEffect(() => {
    const handleKeyDown = (e) => {
      // Only handle keys if no input element is focused
      if (document.activeElement.tagName === 'INPUT' || 
          document.activeElement.tagName === 'TEXTAREA' || 
          document.activeElement.tagName === 'SELECT') {
        return;
      }

      // Mode switching
      if (e.key === 'j') setMode('joint');
      if (e.key === 'c') setMode('cartesian');

      // Velocity presets
      if (e.key === '1') setVelocity(10);
      if (e.key === '2') setVelocity(25);
      if (e.key === '3') setVelocity(50);
      if (e.key === '4') setVelocity(75);
      if (e.key === '5') setVelocity(100);

      // Joint controls
      if (mode === 'joint') {
        const jointMap = {
          'q': { joint: 'base_rotation', direction: 1 },
          'a': { joint: 'base_rotation', direction: -1 },
          'w': { joint: 'shoulder_rotation', direction: 1 },
          's': { joint: 'shoulder_rotation', direction: -1 },
          'e': { joint: 'prismatic_extension', direction: 1 },
          'd': { joint: 'prismatic_extension', direction: -1 },
          'r': { joint: 'elbow_rotation', direction: 1 },
          'f': { joint: 'elbow_rotation', direction: -1 },
          't': { joint: 'wrist_rotation', direction: 1 },
          'g': { joint: 'wrist_rotation', direction: -1 },
          'y': { joint: 'end_effector_rotation', direction: 1 },
          'h': { joint: 'end_effector_rotation', direction: -1 },
        };

        if (jointMap[e.key]) {
          startJog(jointMap[e.key].joint, jointMap[e.key].direction);
        }
      }

      // Cartesian controls
      if (mode === 'cartesian') {
        const axisMap = {
          'ArrowRight': { axis: 'x', direction: 1 },
          'ArrowLeft': { axis: 'x', direction: -1 },
          'ArrowUp': { axis: 'y', direction: 1 },
          'ArrowDown': { axis: 'y', direction: -1 },
          'PageUp': { axis: 'z', direction: 1 },
          'PageDown': { axis: 'z', direction: -1 },
          'u': { axis: 'roll', direction: 1 },
          'j': { axis: 'roll', direction: -1 },
          'i': { axis: 'pitch', direction: 1 },
          'k': { axis: 'pitch', direction: -1 },
          'o': { axis: 'yaw', direction: 1 },
          'l': { axis: 'yaw', direction: -1 },
        };

        if (axisMap[e.key]) {
          startJog(axisMap[e.key].axis, axisMap[e.key].direction);
        }
      }
    };

    const handleKeyUp = (e) => {
      // Stop jogging when key is released
      stopJog();
    };

    window.addEventListener('keydown', handleKeyDown);
    window.addEventListener('keyup', handleKeyUp);

    return () => {
      window.removeEventListener('keydown', handleKeyDown);
      window.removeEventListener('keyup', handleKeyUp);
    };
  }, [mode, velocity, sendWebSocketMessage]);

  // Start jogging in a specific direction
  const startJog = (target, direction) => {
    if (activeJog) {
      stopJog();
    }

    const jogData = {
      type: 'jog_start',
      mode: mode,
      direction: direction,
      velocity: velocity
    };

    if (mode === 'joint') {
      jogData.joint = target;
    } else {
      jogData.axis = target;
    }

    sendWebSocketMessage(jogData);
    setActiveJog({ target, direction });
  };

  // Stop jogging
  const stopJog = () => {
    if (activeJog) {
      sendWebSocketMessage({ type: 'jog_stop' });
      setActiveJog(null);
    }
  };

  // Update velocity
  const updateVelocity = (newVelocity) => {
    setVelocity(newVelocity);
    sendWebSocketMessage({ type: 'jog_velocity', velocity: newVelocity });
  };

  return (
    <div className="jog-control">
      <h2>Jogging Controls</h2>

      <div className="mode-selector">
        <button 
          className={`mode-button ${mode === 'joint' ? 'active' : ''}`}
          onClick={() => setMode('joint')}
        >
          Joint Mode (J)
        </button>
        <button 
          className={`mode-button ${mode === 'cartesian' ? 'active' : ''}`}
          onClick={() => setMode('cartesian')}
        >
          Cartesian Mode (C)
        </button>
      </div>

      <div className="velocity-control">
        <h3>Velocity: {velocity}%</h3>
        <ReactSlider
          className="velocity-slider"
          thumbClassName="velocity-thumb"
          trackClassName="velocity-track"
          value={velocity}
          onChange={updateVelocity}
          min={1}
          max={100}
        />
        <div className="velocity-presets">
          <button onClick={() => updateVelocity(10)}>10% (1)</button>
          <button onClick={() => updateVelocity(25)}>25% (2)</button>
          <button onClick={() => updateVelocity(50)}>50% (3)</button>
          <button onClick={() => updateVelocity(75)}>75% (4)</button>
          <button onClick={() => updateVelocity(100)}>100% (5)</button>
        </div>
      </div>

      {mode === 'joint' ? (
        <div className="joint-controls">
          <h3>Joint Controls</h3>
          <div className="joint-buttons">
            {Object.entries(joints).map(([joint, label]) => (
              <div key={joint} className="joint-control-row">
                <span className="joint-label">{label}</span>
                <button
                  className="jog-button"
                  onMouseDown={() => startJog(joint, -1)}
                  onMouseUp={stopJog}
                  onMouseLeave={stopJog}
                >
                  -
                </button>
                <button
                  className="jog-button"
                  onMouseDown={() => startJog(joint, 1)}
                  onMouseUp={stopJog}
                  onMouseLeave={stopJog}
                >
                  +
                </button>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <div className="cartesian-controls">
          <h3>Cartesian Controls</h3>
          <div className="cartesian-buttons">
            {Object.entries(axes).map(([axis, label]) => (
              <div key={axis} className="cartesian-control-row">
                <span className="axis-label">{label}</span>
                <button
                  className="jog-button"
                  onMouseDown={() => startJog(axis, -1)}
                  onMouseUp={stopJog}
                  onMouseLeave={stopJog}
                >
                  -
                </button>
                <button
                  className="jog-button"
                  onMouseDown={() => startJog(axis, 1)}
                  onMouseUp={stopJog}
                  onMouseLeave={stopJog}
                >
                  +
                </button>
              </div>
            ))}
          </div>
        </div>
      )}

      <div className="keyboard-shortcuts">
        <h3>Keyboard Shortcuts</h3>
        <p>Mode: J - Joint Mode, C - Cartesian Mode</p>
        <p>Velocity: 1-5 for 10%, 25%, 50%, 75%, 100%</p>
        {mode === 'joint' ? (
          <div>
            <p>Q/A - Base, W/S - Shoulder, E/D - Extension</p>
            <p>R/F - Elbow, T/G - Wrist, Y/H - End Effector</p>
          </div>
        ) : (
          <div>
            <p>Arrow Keys - X/Y, Page Up/Down - Z</p>
            <p>U/J - Roll, I/K - Pitch, O/L - Yaw</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default JogControl;
